<?php

namespace OnlineUniConverter\Tests\Feature;

use OnlineUniConverter\Models\Common;
use OnlineUniConverter\Models\Import;

class ImportTest extends TestCase
{
    public function testImportUpload()
    {
        // init
        $import = (new Import('upload'));
        $this->OnlineUniConverter->imports()->create($import);

        // upload
        $this->OnlineUniConverter->imports()->upload($import, fopen(__DIR__ . '/files/test.mov', 'r'), 'vid00084source.mov');

        // info
        $this->assertEquals(Common::STATUS_SUCCESS, $import->getStatus());
        $this->assertEquals('vid00084source.mov', $import->getResult()->files[0]->filename);
    }

    public function testImportUrl()
    {
        // init
        $import = (new Import('url'))
            ->set('url', 'https://api.media.io/s0/v1/download?task_id=K4Zy2sgT-4dc985a68c192fefec3e89d9cb7837e8&taskType=wmv_mp4')
            ->set('file_name', 'test.mp4');
        $this->OnlineUniConverter->imports()->create($import);
        $this->assertNotNull($import->getId());
        $this->assertNotNull($import->getCreatedAt());
        $this->assertEquals('import/url', $import->getOperation());
        $this->assertEquals([
            'url' => 'https://api.media.io/s0/v1/download?task_id=K4Zy2sgT-4dc985a68c192fefec3e89d9cb7837e8&taskType=wmv_mp4',
            'file_name' => 'test.mp4'
        ], (array)$import->getPayload());
        $this->assertEquals(Common::STATUS_WAITING, $import->getStatus());
    }

    public function testImportBase64()
    {
        // init
        $import = (new Import('base64'))
            ->set('content', '')
            ->set('file_name', 'test.jpg');
        $this->OnlineUniConverter->imports()->create($import);
        $this->assertNotNull($import->getId());
        $this->assertNotNull($import->getCreatedAt());
        $this->assertEquals('import/base64', $import->getOperation());
        $this->assertEquals(Common::STATUS_WAITING, $import->getStatus());
    }
}
